Node JS Rest Service distinct with multimple field<p>I'm developing backend using node js and MongoDB.
I have developed GET and POST request. I have used GET request with a distinct on specific field:</p>

<pre><code>router.get('/machine/:brand', function(req,res){
Machine.find({Brand:req.params.brand}).distinct('Version', (err, machines) =&gt; {
if (err) {
    console.log(err);
    return res.status(400).send({ status: 'ko', data: {msg: err.message }});
    console.log(err);
}
res.status(200).send({status: 'ok', data: {msg: 'Brands available', brand:machines}});
});
});
</code></pre>

<p>this request works well and give me a list of all version for specific brand machine.
Now i need to retrive with version also a model that is other field of machine table.
It's possible to use distinct with 2 field?
How i can retrieve the distinct of 2 field in a unique GET request?</p>

