Query MongoDB documents where min and max columns encompass a value<p>My documents have the following structure, where <code>start</code> and <code>end</code> represent hours in the format of <code>HH:MM</code>:</p>

<pre><code>{_id: 1, start: "11:30", end: "14:30" }
{_id: 2, start: "05:30", end: "11:30" }
{_id: 3, start: "14:30", end: "18:00" }
{_id: 4, start: "18:30", end: "23:59" }
</code></pre>

<p>I receive another <code>HH:MM</code> value. Then, I need to obtain the <code>_id</code> of the record where the value I got is between the <code>start</code> and <code>end</code> range.</p>

<p>For example, if I have the value <code>15:18</code>, I will need to obtain <code>_id = 3</code>, because <code>start &gt; 15:18</code> and <code>end &lt;= 15:18</code>.</p>

<p>The examples I've found show the opposite case (having the min/max values and querying which row has a cell between those values). <a href="https://vladmihalcea.com/mongodb-time-series-introducing-the-aggregation-framework/" rel="nofollow noreferrer">This is an example</a>, and <a href="http://www.tinnedgeek.com/how-to-search-a-mongodb-database-for-entries-between-two-dates-or-times/" rel="nofollow noreferrer">this is another example</a>, and <a href="https://stackoverflow.com/questions/2943222/find-objects-between-two-dates-mongodb">another one</a>.</p>

