<p>I have the following Collection Document that I am querying for:</p>

<pre><code>{
    "_id": {
        "$oid": "5bd0d709ff8eef5d5325090f"
    },
    "audienceTrackingID": "3e66c213-fe0b-4096-a99c-558a6c349b4b",
    "mainframeTrackingID": null,
    "partner1TrackingID": "85c5f168-08da-44d3-bbef-fbb3b8392ded",
    "__v": 0,
    "contentFocus": "Cooking",
    "ipRange": [
        "29.142.127.151"
    ]
}
</code></pre>

<p>With the following query:</p>

<pre><code>console.log(req.headers['x-original-ip']) // '29.142.127.151'
