    }]
})

console.log(clientMatch) // null
</code></pre>

<p>Somewhat puzzling, as querying for individual fields, as well as removing my query where the param is undefined within the actual query (<code>req.headers['x-audience-tracking-id']</code>) will produce results (Which makes me wonder, why is this acting like an AND and giving me null when one queryfield fails???)</p>

